#Python program to print topological sorting of a DAG 
from collections import defaultdict 
  
#Class to represent a graph 
class Graph: 
    def __init__(self,vertices): 
        self.graph = defaultdict(list) #dictionary containing adjacency List 
        self.V = vertices #No. of vertices 
  
    # function to add an edge to graph 
    def addEdge(self,u,v): 
        self.graph[u].append(v) 


class Solution:
    def longestIncreasingPath(self, matrix):
    	if matrix == []:
    		return 0
    	self.rLen,self.cLen = len(matrix),len(matrix[0])
    	self.matGraph = Graph(self.rLen*self.cLen)

    	def fun(pos):
    		if pos[0]>=0 and pos[0] < self.rLen \
    		    and pos[1] >= 0 and pos[1] < self.cLen \
    		    and matrix[pos[0]][pos[1]]>self.Val:
    		    return True
    		else:
    			return False

    	def fillCnt(pos,cnt):
    		for posi in self.matGraph.graph[pos]:
    			self.cntMat[posi[0]][posi[1]]=max(cnt+1,self.cntMat[posi[0]][posi[1]])
    			self.max = max(self.max,cnt+1)
    			if posi in self.matGraph.graph:
    				fillCnt(posi,cnt+1)


    	start = [(i,j) for i in range(self.rLen) for j in range(self.cLen)]
    	for i in range(self.rLen):
    		for j in range(self.cLen):
    			self.Val = matrix[i][j]
    			for vertex in filter(fun,[(i-1,j),(i,j-1),(i+1,j),(i,j+1)]):
    				self.matGraph.addEdge((i,j),vertex)
    				if vertex in start:
    					start.remove(vertex)
    	# print(start)
    	self.cntMat,self.max = [[0 for ii in range(self.cLen)] for jj in range(self.rLen)],1
    	for starter in start:
    		self.cntMat[starter[0]][starter[1]],cnt,pos = 1,1,starter
    		fillCnt(starter,cnt)

    	return self.max


